This is to fix typing for our existing working code:


```ts
let b = new L.LatLngBounds();
```

and 

```ts
class AnIcon extends L.DivIcon {
  public createIcon() { return document.createElement('div'); }
}

class AMarker extends L.Marker {
  constructor(latLng: L.LatLng) {
    super(L.latLng(latLng), { icon: new AnIcon() });
  }
}

```

At the moment, cucumber definition types only allow to add a custom world without any parameter

type -> `setWorldConstructor(world: () => void): void;`

```
var {defineSupportCode} = require('cucumber');
var seleniumWebdriver = require('selenium-webdriver');

function CustomWorld() {
  this.driver = new seleniumWebdriver.Builder()
    .forBrowser('firefox')
    .build();

  // Returns a promise that resolves to the element
  this.waitForElement = function(locator) {
    var condition = seleniumWebdriver.until.elementLocated(locator);
    return this.driver.wait(condition)
  }
}

defineSupportCode(function({setWorldConstructor}) {
  setWorldConstructor(CustomWorld)
});
```


So with this change

type -> `setWorldConstructor(world: (() => void) | ({})): void;`

it will be possible to do: 

```
var {defineSupportCode} = require('cucumber');
var seleniumWebdriver = require('selenium-webdriver');

function CustomWorld({attach, parameters}) {
  this.attach = attach;
  this.parameters = parameters;
  this.driver = new seleniumWebdriver.Builder()
    .forBrowser('firefox')
    .build();

  // Returns a promise that resolves to the element
  this.waitForElement = function(locator) {
    var condition = seleniumWebdriver.until.elementLocated(locator);
    return this.driver.wait(condition)
  }
}

defineSupportCode(function({setWorldConstructor}) {
  setWorldConstructor(CustomWorld)
});
```
This change will allow to use attach() in custom world, without losing the possibility of add a screenshot error, p.e, on JSON output.

